('lv', '_template', 'atutor_accessibility_text', '<p>ATutor paredz dažādas iespējas, kas veidotas tā, lai nodrošinātu materiāla pieejamību visiem potenciālajiem lietotājiem, ieskaitot tos, kam ir lēns Interneta pieslēgums, novecojušas pārlūkprogrammas, kā arī cilvēkiem ar speciālām vajadzībām, kas lieto palīgtehnoloģijas, lai piekļūtu Interneta resursiem. Šīs iespējas detalizēti tiek apskatītas tālāk. Atkarībā no izmantotās tēmas, ATutor var saturēt visas vai dažas no šeit uzskaitītajām iespējām. Tēma pēc noklusējuma satur visas iespējas.</p> <ol> <li><b>Saišu Apiešana:</b> ATutor kreisajā augšējā stūrī ir slēptā apejošā saite, kas ļauj palīgtehnoloģiju lietotājiem apiet navigācijas elementus un nokļūt uzreiz patlaban attēlojamā materiāla sākumā. Nospied Tab taustiņu uzreiz pēc lapas ielādes, lai nokļūtu uz pirmo apejošo saiti, pēc tam nospied Enter, lai materiālu pārvietotu līdz ekrāna augšai. Uz satura sākumu var pārvietoties arī ar kombināciju [Alt-c], tādējādi ir iespējams pāriet uz satura sākumu neatkarīgi no tā, kur kursors atrodas uz ekrāna.<br /><br /> Citas apejošās saites ietver: \"tabulas apiešana\", kad lietotāji var apiet dažādas datu tabulas, lai ātri piekļūtu mateiālam, kas varētu būt pēc tabulas; \"kodu apiešana\", kad lietotāji var apiet emocijikonu kodus ziņojumloga apakšā Diskusijās.<br /><br /></li> <li><strong>Piekļuves taustiņi:</strong>Klaviatūras pieejamība ir kā papildinājums daudzām ATutor iespējām. Lai aktivizētu piekļuves taustiņus, jānospiež taustiņš Alt kopā ar attiecīgo cipara, burta vai simbola taustiņu. Piekļuves taustiņi tiek veidoti dinamiski Galvenās Navigācijas sadaļām. Pirmajai sadaļai tiks piešķirts [Alt-1], otrajai tiks piešķirts [Alt-2] un tā tālāk. Jāatzīmē, ka ne visas pārlūkprogrammas akceptē piekļuves taustiņus.<br /><br /> Vispārējie Piekļuves Taustiņi <ul> <li>[Alt 1 līdz Alt-0] Galvenās Navigācijas Sadaļas</li> <li>[Alt-,] Iepriekšējais temats (t.i. kreisā leņķiekava <)</li> <li>[Alt-.] Nākošais temats (t.i. labā leņķiekava >)</li> <li>[Alt-.] Atsākt (t.i. labā leņķiekava >, atrodoties ārpus kursa materiāla)</li> <li>[Alt-j] Aiziet! izvēlne</li> <li>[Alt-s] Iesūtīt (darbojas daudzās formu lapās)</li> <li>[Alt c] Pāriet uz materiāla sākumu (uz sākumu un saites izlaišana)</li> </ul> Materiāla Redaktora Piekļuves Taustiņi <ul> <li>[Alt-n] Satura Sadaļa</li> <li>[Alt-p] Uzstādījumu Sadaļa</li> <li>[Alt-g] Glosārija Sadaļa</li> <li>[Alt-r] Priekšapskates Sadaļa</li> <li>[Alt-a] Pieejamības Sadaļa</li> <li>[Alt-s] Saglabāt</li> </ul> Čata Piekļuves Taustiņi <ul> <li>[Alt-c] Pāriet uz Ziņojuma Sastādīšanas lauku</li> <li>[Alt-r] Atjaunot Ziņojumus</li> <li>[Alt-m] Pāriet uz Ziņojumu Sarakstu</li> <li>[Alt-q] Iziet no Čata</li> </ul> Pastkastes Piekļuves Taustiņi <ul> <li>[Alt-r] Atbildēt uz Ziņojumiem</li> </ul> <br /> </li> <li><strong>Peejamības Pārbaude:</strong> Lietojot ATutor Satura Redaktoru, pasniedzēji var pārbaudīt veidojamā satura pieejamību, lai pārliecinātos, ka tas būs pieejams visiem lietotājiem, ieskaitot tos, kas lieto palīgtehnoloģijas, kā arī tos, kas lieto vecākas tehnoloģijas, lai mācītos tiešsaistē. Lietojot Satura Redaktoru, jāizvēlas [Alt-a], lai atvērtu pieejamības kontroli.</li> <li><strong>Alternatīvais Teksts:</strong> Visi attēli ATutor sistēmā satur teksta alternatīvu, kas apraksta attēlu vai tā funkciju. Ja attēli ir bez nozīmes, Alt atribūts atstāts tukšs, lai palīgtehnoloģijas varētu ignorēt attēlu.</li> <li><strong>Alternatīvā Navigācija:</strong> Vispārējās, hierarhiskās un secīgās navigācijas rīki ir pieejami lietotājiem materiāla apskatei vai sakārtošanai atbilstoši mācīšanās stilam. ATutor Vietnes Karte piedāvā pilnu satura un rīku sarakstu, lai visām kursa iespējām varētu piekļūt no vienas vietnes.</li> <li><strong>Atsākt/Turpināt: </strong>ATutor atceras pēdējo lapu, kas tikusi apmeklēta, kad lietotājs iziet no kursa materiāla, lai pārietu, piemēram, uz Diskusijām, lai, atgriežoties ATutor, lietotāji varētu vienkārši izvēlēties Atsākšanas saiti kursu sarakstā sadaļā Mani Kursi vai atsākšanas saiti taciņās ekrāna augšdaļā, kad atgriežas kursā. Lietojot [Alt-.] kombināciju, lietotājs tāpat tiek atgriezts pēdējā skatītajā materiāla lapā, kad atgriežas kursā.</li> <li><strong>Paslēpt Izvēlnes:</strong> Vecāku palīgtehnoloģiju lietotājiem, kuras neatbalsta teksta aiļu izkārtojumu tabulās, var paslēpt ATutor izvēlnes tā, ka materiāls tiks rādīts lineārā prezentācijā. Izvēlņu paslēpšana arī ietaupa vietu lietotājiem ar mazākām monitoru izšķirtspējām.</li> <li><strong>Meklēšana un Kārtošana:</strong> vairums datu tabulu aprīkotas ar meklēšanas rīku vai filtru, lai specifiskos ierakstus varētu attēlot tabulā, samazinot datu daudzumu, kas tiek rādīts katrā konkrētā laikā. Vairums tabulu var tikt sakārtotas, izvēloties ailes virsrakstu, samazinot attēlojamo datu apjomu.</li> <li><strong>Tabulu Galveņu Asociēšana: </strong>Visas datu tabulas tiek marķētas ar TH elementu un redzamības apgabala (scope) atribūtu, lai ekrānlasītāju lietotāji varētu pārvietoties pa datu attēlojumiem un saprast, ko katra datu šūna reprezentē.</li> <li><strong>Formu Virsraksti:</strong> Visi formu lauki ATutor sistēmā ir paskaidroti ar atbilstošiem teksta elementiem, nodrošinot pareizu to aprakstu palīgtehnoloģiju lietotājiem. Speciālā apzīmēšana šādā veidā dod arī iespēju aktivizēt formas lauku, uzklikšķinot uz šo paskaidrojošo tekstu. Tas dod lielāku mērķlaukumu cilvēkiem, kam ir grūtības pozicionēt peles kursoru uz maziem formas laukiem, kādi, piemēram, ir izvēles pogas.</li> <li><strong>Stila Saraksti:</strong> Kur tas ir iespējams, ATutor materiāla atspoguļojumu kontrolē stila saraksta elementi. Tas ļauj lietotājiem atsaukt ATutor izskatu pēc noklusējuma un piemērot sev piemērotu parādīšanas stilu (t.i. palielināts burtu izmērs, cits burtu veids, krāsa, u.c.) </li> <li><strong>Formu Lauku Fokuss:</strong> Lapām, kur pamatsaturs ir forma, peles kursors automātiski tiek novietots pirmajā laukā, tāpēc lietotāji var sākt datu ievadi tiklīdz lapa ir ielādējusies. Lietotāji var atcelt formu fokusu savos uzstādījumos, ja tas neatbilst viņu formu lietošanas veidam.</li> <li><strong>Attēlu Relatīvā Mērogošana:</strong> Ar pārlūkprogrammām, kas atbalsta attēlu mērogošanu, ATutor piktogrammas var tikt palielinātas, atbalstot lietotājus ar vāju redzi un padarot tās vieglāk saskatāmas (piem., Netscape 7 jānospiež Alt +). Kur iespējams relatīvie izmēri ir lietoti citām ATutor iespējām, lai, palielinot vai samazinot saskarnes elementus, tie mērogotos savstarpēji relatīvi, saglabājot ekrāna simetriju. </li> </ol>', '2006-11-29 11:37:06', ''),
