('lv', '_template', 'atutor_is', '<strong><em>ATutor</em></strong> ir Atvērtā Pirmkoda Tīmeklī lietojama <strong>Mācību Materiāla Pārvaldības Sistēma (MMPS)</strong>, kas veidota domājot par pieejamību un adaptējamību. Administratori var instalēt un atjaunot ATutor dažu minūšu laikā. Pasniedzēji var ātri apkopot, sapakot un izplatīt mācību materiālu un vadīt savus kursus tiešsaistē. Studenti mācās pielāgojamā mācību vidē.', '2004-02-26 14:18:55', ''),
('lv', '_template', 'atutor_links', '<p>Uzzini vairāk par <a href=\"http://atutor.ca/index.php\">ATutor</a>, pārlūkojot sekojošas saites:</p> <ul> <li><a href=\"http://atutor.ca/atutor/docs/index.php\">BUJi</a> - Biēži uzdoti jautājumi ar atbildēm</li> <li><a href=\"http://atutor.ca/forums/index.php\">Atbalsta Diskusijas</a> - Iesūtīt lietotāju diskusijās</li> <li><a href=\"http://atutor.ca/services/index.php\">Atbalsta Servisi</a> - Ja nepieciešama palīdzība, atbalsts ir iespējams</li> <li><a href=\"http://atutor.ca/atutor/translate/index.php\">Tulkošana</a> - Lejupielādēt valodu pakotnes, kļūt par tulkotāju</li> <li><a href=\"http://atutor.ca/services/licensing.php\">Licences</a> - ATutor programmatūra pieejama bez maksas, ievērojot dažus noteikumus</li> <li><a href=\"http://atutor.ca/atutor/download.php\">Lejupielādēt ATutor</a> - Visa sitēmas programmatūra, kas nepieciešama, lai darbinātu ATutor, var tikt lejupielādēta šeit.</li> </ul>', '2006-11-29 10:39:06', ''),
