('lv', '_template', 'chat_help_display_blurb', '<p>Piezīme: <em>Pāriet Uz</em> saites un <em>Ātro Taustiņu</em> saraksts parādās tikai, ja Tavos uzstādījumos ieslēgti <em>Navigācijas Līdzekļi</em>.</p> <ul> <li><em>Pāriet uz Ātrajiem Taustiņiem</em> saite augšā parāda ātro taustiņu sarakstu, kurus var lietot Čatā. </li> <li><em>Ziņojumu Zona</em> rāda jaunākos ziņojumus (līdz desmit). </li> <li> <em>Pāriet uz Ziņojumiem</em> saite pārnes uz ziņojumu saraksta sākumu. (Alt+M) </li> <li> <em>Atjaunot Ziņojumus</em> saite ļauj pārbaudīt jauno ziņojumu esamību (Alt+R). </li> <li> <em>Sastādīt Ziņojumu</em> Lauks un <em>spiedpoga Sūtīt</em> ļauj ievadīt un nosūtīt ziņojumus (Alt+C, lai nonāktu Sastādīšanas Laukā, Enter, lai nosūtītu sastādīto ziņojumu. </li> </ul>', '2004-08-20 14:48:43', ''),
